INSERT INTO `song_list` VALUES (1,'The Good, the Bad and the Ugly','/music/songListPic/1726190239-70c974d6.jpg','he Good, the Bad and the Ugly: Original Motion Picture Soundtrack was released in 1966 alongside the Western film, The Good, the Bad and the Ugly, directed by Sergio Leone. The score is composed by frequent Leone collaborator Ennio Morricone, whose distinctive original compositions, containing gunfire, whistling, and yodeling permeate the film. The main theme, resembling the howling of a coyote, is a two-note melody that is a frequent motif, and is used for the three main characters, with a different instrument used for each one: flute for Blondie (Man With No Name), Arghilofono (Ocarina) for Angel Eyes, and human voices for Tuco.','华语'),(2,' ','/img/songListPic/wv2NdfZrUnLDSwk_kQoSZg==_109951163751040922.jpg','','华语'),(3,'','/img/songListPic/q0ZyCw22PCiTG2LX_A2kew==_109951163594989759.jpg','','华语'),(4,'312','/img/songListPic/109951163271025942.jpg','\n\n\n\n\n\n\n\n\n\n\n\n','华语'),(5,'','/img/songListPic/109951163609743240.jpg','\n\n','华语'),(6,'','/img/songListPic/19080924789030458.jpg','\n\n','华语'),(7,'   vlog  BGM','/img/songListPic/vLSB9-NGsd4CLYf_4ShGww==_109951163609572271.jpg','','华语'),(8,'()','/img/songListPic/92NWlGo76ha-if-WMK3vCg==_1410673428769729.jpg','','华语'),(9,'','/img/songListPic/QHD2Uy2y9ktndbK1UKgdgg==_18611433325258133.jpg','','华语'),(10,'OST','/img/songListPic/zhunizouguobansheng.jpg','','华语'),(11,'','/img/songListPic/109951163919069037.jpg','\n\n\n\n\n\n\n',''),(12,'','/img/songListPic/109951163936991203.jpg','\n\n\n\n\n\n       \n\n...',''),(13,'','/img/songListPic/109951163216834301.jpg','\"\"\n\n',''),(14,'||','/img/songListPic/109951163443093546.jpg','\n\n\n\n\n\n',''),(15,'','/img/songListPic/109951163887710551.jpg',' \n  \n \n\n\n \n',''),(16,'','/img/songListPic/109951163858422257.jpg','',''),(17,'ost','/img/songListPic/109951163826485303.jpg','',''),(18,'','/img/songListPic/109951163311246502.jpg','...\n...\n...\n...\n...','')